import React from 'react';
import {Box, Modal} from '@mui/material';


const ModalPopup = ({open, handleClose, text}) => {
  return (
    <Modal
        open={open}
        onClose={handleClose}
    >
        <Box className="modal-popup">
            {text}
        </Box>
    </Modal>
  )
}

export default ModalPopup;
